import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<mat-toolbar class="nav">
<span>My Profile
    <mat-icon class="example-icon" aria-hidden="false" >person</mat-icon>
</span>

<ul>
    <li>Education</li>
    <li>Skills</li>
    <li>projects</li>
</ul>
</mat-toolbar>
